import Foundation

extension Marker {
    var icon: Icon {
        switch type {
        case .standard:
            return .standard
        case let .todo(completed):
            return completed ? .completed : .todo
        case .chapter:
            return .chapter
        }
    }

    enum Icon {
        case chapter
        case completed
        case todo
        case standard

        enum Chapter {
            static let fileName = "marker-chapter.png"
            static let bin = Data(base64Encoded:
                ""
            )!
        }

        enum Completed {
            static let fileName = "marker-completed.png"
            static let bin = Data(base64Encoded:
                ""
            )!
        }

        enum ToDo {
            static let fileName = "marker-to-do.png"
            static let bin = Data(base64Encoded:
                ""
            )!
        }

        enum Standard {
            static let fileName = "marker.png"
            static let bin = Data(base64Encoded:
                ""
            )!
        }

        var bin: Data {
            switch self {
            case .chapter: return Chapter.bin
            case .completed: return Completed.bin
            case .todo: return ToDo.bin
            case .standard: return Standard.bin
            }
        }

        var fileName: String {
            switch self {
            case .chapter: return Chapter.fileName
            case .completed: return Completed.fileName
            case .todo: return ToDo.fileName
            case .standard: return Standard.fileName
            }
        }
    }
}
